import { Box, Grid, InputLabel, TextField, Button, Typography, Container } from '@material-ui/core';
import React, { Component } from 'react';
import { connect } from 'react-redux';
import mapStoreToProps from '../../redux/mapStoreToProps';

class Register extends Component {
  state = {
    firstName: '',
    lastName: '',
    email: '',
    password: '',
    dob: '',
    address: '',
    occupation: '',
    typeOfHome: '',
    interestedIn: this.props.store.interestedIn
  };
  registerUser = (event) => {
    event.preventDefault();
    this.props.dispatch({
      type: 'REGISTER',
      payload: {
        firstName: this.state.firstName,
        lastName: this.state.lastName,
        email: this.state.email,
        password: this.state.password,
        dob: this.state.dob,
        address: this.state.address,
        occupation: this.state.occupation,
        typeOfHome: this.state.typeOfHome,
      },
    });
  };
  handleInputChangeFor = (propertyName) => (event) => {
    this.setState({
      [propertyName]: event.target.value,
    });
  };

  render() {
    return (
      <Container>
        <Grid container direction="column" alignItems="flex-start">
      {/* <form className="formPanel" onSubmit={this.registerUser}> */}
        <Typography variant="h6">Register For Adoption</Typography>
        <Grid item>
          <InputLabel htmlFor="username">
            Username:
            <TextField
              type="text"
              name="username"
              value={this.state.username}
              required
              onChange={this.handleInputChangeFor('username')}
            />
          </InputLabel>
        </Grid>
        <Grid item>
          <InputLabel htmlFor="password">
            Password:
            <TextField
              type="password"
              name="password"
              value={this.state.password}
              required
              onChange={this.handleInputChangeFor('password')}
            />
          </InputLabel>
        </Grid>
        <Grid item>
          <Button variant="outlined" color="primary" onClick={this.registerUser}>Register</Button>
          {/* <input className="btn" type="submit" name="submit" value="Register" /> */}
        </Grid>
      {/* </form> */}
      </Grid></Container>
    );
  }
}

export default connect(mapStoreToProps)(Register);
